import { BrowserRouter, Route, Link, Routes } from "react-router-dom";

function App() {
    return (
        <Router>
            <div className="App">
                <p> Lets route! </p>
                <nav>
                    <Link to="/"> Home </Link>
                    <Link to="/dashboard"> Dashboard </Link>
                </nav>
            </div>
            <Routes>
                <Route path="/" element={<Home/>}/>
                <Route path="/dashboard" element={<Dashboard/>}/>
            </Routes>
        </Router>
    )
}

export default App;
